import axios from 'axios';


export const getBooks = (dispatch) => {
    axios
    .get('http://127.0.0.1:8000/api/pages/books')
    .then((res) => {
      dispatch({
        type: "GET_BOOKS",
        payload: res.data,
      });
    })
    .catch((err) => {
     // dispatch(returnErrors(err.response.data, err.response.status));
      console.log("error getting books ...");
    });
}
